// Get RefId from Previous Test Case

import groovy.json.*

// Get Payload from Previous Test Case
def response = context.expand( '${#[TestSuite 1#StudentProviderEnrolment-Multiple#GetStudentProviderEnrolments]#Response}' )
def slurped = new JsonSlurper().parseText(response)

// Get RefId from Random Record
def speCount = slurped.StudentProviderEnrolments.StudentProviderEnrolment.size()
Random random = new Random()
int rndIndex = random.nextInt(speCount)
def refId = slurped.StudentProviderEnrolments.StudentProviderEnrolment[rndIndex].StudentProviderEnrolmentRefId

// Set RefId to Property
testRunner.testCase.testSteps["Properties 1"].setPropertyValue( "StudentProviderEnrolmentRefId", refId )

